a\u00f1ana, al ejercer mi profesi\u00f3n, dejar una huella positiva en la vida de las personas.\u2728\u2800\n\u2800\n\u25a0 \u00bfC\u00f3mo te ves en 10 a\u00f1os?\u2800\u2800\nMe veo teniendo mi propio despacho de dise\u00f1o, no solo con fines comerciales, sino enfocarme en el dise\u00f1o social.\u2728\u2800\n\u2800\n\u25a0 Frase favorita:\u2800\u2800\n\u201cEs a trav\u00e9s de los errores que realmente puedes crecer.\u00a0Tienes que ser malo para ser bueno.\u201d \u2013\u2728Paula Scher\u2728"}}]},"shortcode":"CfcrLWFrN0l","edge_media_to_comment":{"count":1},"taken_at_timestamp":1656632083,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291245944_1649940355379546_6883893264371804837_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=102\u0026_nc_ohc=NJJve9SwxZkAX-kE06r\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_NjVErMycU2M9Qx-_oNm46gcZGUWA6HnQdJ3gAtaEApw\u0026oe=62C4CC4A\u0026_nc_sid=4efc9f","edge_liked_by":{"count":8},"edge_media_preview_like":{"count":8},"owner":{"id":"17921354210"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291245944_1649940355379546_6883893264371804837_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=102\u0026_nc_ohc=NJJve9SwxZkAX-kE06r\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_RW1uwnas0HhxfkBEX0xtNfxudlo7xUfHpBWDH-PO64g\u0026oe=62C4CC4A\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291245944_1649940355379546_6883893264371804837_n.jpg?stp=dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=102\u0026_nc_ohc=NJJve9SwxZkAX-kE06r\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8uQeBeLC2rO6qvbpekk7tTH_VS7TARAVyicXVQtmt_VQ\u0026oe=62C4CC4A\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291245944_16499403