WA Honor School Banner, and a possible Scholarship grant for a student by establishing a school-based Writing Club.\n\nThe Florida Writers Association Youth Program assists middle and high schools to establish school-based Writing Clubs (4 students minimum with a teacher volunteer) meeting the equivalent of 90 minutes per month for 8 months. \n\nOur goal is to create a climate of acceptance to assist students of all skill levels to improve their writing.\n\nFor more information visit our website or email fway@floridawriters.org.\n\n#floridaeducators #floridateachers #scholarships #writingclub #floridawritersassociation"}}]},"shortcode":"CfcgogGJ-cD","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656626554,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290944619_752817449196921_4313968432606488615_n.jpg?stp=dst-jpg_e15_fr_s1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=JWqFVo9fJMUAX8mcmSF\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT97h3WraaLQPDwGxiHRXFFArX6FVSz4MM8n202jWrM3Sw\u0026oe=62C4A051\u0026_nc_sid=4efc9f","edge_liked_by":{"count":3},"edge_media_preview_like":{"count":3},"owner":{"id":"6200454006"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290944619_752817449196921_4313968432606488615_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=JWqFVo9fJMUAX8mcmSF\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9FGdKNqsGvcOTFtlFM-5KHr646Cm98sDiaOpAFShnvMw\u0026oe=62C4A051\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290944619_752817449196921_4313968432606488615_n.jpg?stp=dst-jpg_e15_s150x150\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=JWqFVo9fJMUAX8mcmSF\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-_pREl1XbFQYAggCsFmH9xOMInZlox40cdTiIneozyZw\u0026oe=62C4A051\u0026_nc_sid=4ef