BB recommends following these tips:\n\n\ud83c\udf93Beware of unsolicited offers. \n\ud83c\udf93Take your time.\n\ud83c\udf93Ask lots of questions.\n\ud83c\udf93Ask your guidance counselor or a college financial aid office whether they have experience with the company.\n\ud83c\udf93Be skeptical of glowing success stories touted on websites or at seminars.\n\ud83c\udf93Ask about fees associated with a professional financial aid search and find out if the company provides refunds. \n\ud83c\udf93Be aware that a check can bounce even after the bank allows cash withdrawal from the deposit. \n\n#BBB #BBBTip #financialaid #college #scholarships #collegebound #payingforcollege #scholarship #collegeadmissions #studentloans #education #collegescholarships #collegeapplications #highschool #collegeplanning #highereducation #fafsahelp #money #studentdebt #highschoolsenior #students #student #payforcollege"}}]},"shortcode":"CfcUrBWFC21","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656620286,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291482023_163351806183147_8538160949191675447_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=Y0NNUVb1TqEAX9rpw7Y\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9syhu0HF9hRThRnhtaJF71InFUHZdnCgXqVfzTxHnLSw\u0026oe=62C4DEBC\u0026_nc_sid=4efc9f","edge_liked_by":{"count":3},"edge_media_preview_like":{"count":3},"owner":{"id":"1558375218"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291482023_163351806183147_8538160949191675447_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=Y0NNUVb1TqEAX9rpw7Y\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8oqNQQpEXgwayyri2DAe40psK5AEyv82b5Otbgwr786A\u0026oe=62C4DEBC\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291482023_163351806183147_8538160